import React, { useEffect } from "react";
import GetWishs from "../API/GetWishs.ts";

function SelfPaje(props)
{
    const [wishs, setWishs] = React.useState([{id:0, present:"", price:"", reservUser:0, userId:0, userName:""}])
    let wishsNotReserv = new Array();
    const [wishsReserv, setWishsReserv] = React.useState([{id:0, present:"", price:"", reservUser:0, userId:0, userName:""}])
    useEffect(()=>{
        const get = async () =>{
          const data = await GetWishs(props.id);
          setWishs(data);
          wishs.forEach((element) => {
            if(element.reservUser==null)
                wishsNotReserv.push(element);
          });
          console.log(wishsNotReserv)
        }
        get();
      }, []);
      if(wishs[0].id==0)
        return(<></>);   
      const listItems = wishsNotReserv.map((wish) =>
        <ul key={wish.id}>
          <li>
            {wish.present}
          </li>
          <li>
            {wish.price}
          </li>
        </ul> 
      );
    
      return (
          <div className="ListWishs">
            {listItems}
          </div>
        );
}
export default SelfPaje
